import React, { Component } from "react";

class Title extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cont: 0,
    };
  }

  // Correcto

  render() {
    return (
      <div className="center">
        <h2>{this.state.cont}</h2>
      </div>
    );
  }
}

export default Title;
